INSERT INTO `v1_04dfbb64c543c043bfdb79cb250d2e365569b2ddd6e12f765e88725476cc52b4` VALUES (1110501046, 11, 111011, 0, "", 1110501, "しかし蝋燭はいいが、この土台部分──\nいや、バースデーケーキとかいう祝祭の\n文化か。ううむ気持ちは有難いが、\n食の細いぼくには若干拷問サイズだ……", 1, 1, 4, 0);
INSERT INTO `v1_04dfbb64c543c043bfdb79cb250d2e365569b2ddd6e12f765e88725476cc52b4` VALUES (1110501047, 91, 0, "", "", 1110501, "", "", "", "", "");
